'use client'

import React from 'react'
import { motion } from 'framer-motion'
import { FileIcon, Share2Icon, ShieldIcon, UserIcon } from 'lucide-react'

export default function Home() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-100 via-purple-50 to-pink-100 flex flex-col justify-center items-center p-4 overflow-hidden">
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8 }}
        className="text-center mb-12"
      >
        <motion.h1
          className="text-5xl md:text-7xl font-bold text-indigo-900 mb-4"
          initial={{ scale: 0.9 }}
          animate={{ scale: 1 }}
          transition={{ type: 'spring', stiffness: 200, damping: 10 }}
        >
          FileFlow
        </motion.h1>
        <motion.p
          className="text-xl md:text-2xl text-indigo-700 max-w-2xl mx-auto"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.2, duration: 0.8 }}
        >
          Seamless file sharing for the modern world. Fast, secure, and effortless.
        </motion.p>
      </motion.div>

      <motion.div
        className="grid grid-cols-1 md:grid-cols-3 gap-8 mb-12"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.4, duration: 0.8 }}
      >
        <FeatureCard
          icon={<FileIcon className="w-12 h-12 text-indigo-500" />}
          title="Easy Uploads"
          description="Drag and drop your files or use our intuitive interface to upload in seconds."
        />
        <FeatureCard
          icon={<Share2Icon className="w-12 h-12 text-indigo-500" />}
          title="Quick Sharing"
          description="Generate shareable links instantly and control access with ease."
        />
        <FeatureCard
          icon={<ShieldIcon className="w-12 h-12 text-indigo-500" />}
          title="Secure Storage"
          description="Your files are encrypted and stored safely in our state-of-the-art servers."
        />
      </motion.div>

      <motion.div
        className="flex flex-wrap justify-center gap-4"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ delay: 0.6, duration: 0.8 }}
      >
        <Link href="/auth" passHref>
          <motion.a
            className="bg-indigo-600 text-white px-8 py-3 rounded-full font-semibold text-lg shadow-lg hover:bg-indigo-700 transition duration-300 flex items-center"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            <UserIcon className="w-5 h-5 mr-2" />
            Get Started
          </motion.a>
        </Link>
        <Link href="/dashboard" passHref>
          <motion.a
            className="bg-white text-indigo-600 px-8 py-3 rounded-full font-semibold text-lg shadow-lg hover:bg-indigo-50 transition duration-300"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            Go to Dashboard
          </motion.a>
        </Link>
      </motion.div>

      <motion.footer
        className="absolute bottom-4 text-center text-indigo-600"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ delay: 0.8, duration: 0.8 }}
      >
        <p>&copy; 2024 FileFlow. All rights reserved.</p>
      </motion.footer>
    </div>
  )
}

function FeatureCard({ icon, title, description }) {
  return (
    <motion.div
      className="bg-white p-6 rounded-xl shadow-xl"
      whileHover={{ scale: 1.05, boxShadow: '0 8px 30px rgba(0,0,0,0.12)' }}
      transition={{ type: 'spring', stiffness: 300, damping: 20 }}
    >
      <div className="flex flex-col items-center text-center">
        {icon}
        <h2 className="mt-4 text-xl font-semibold text-indigo-900">{title}</h2>
        <p className="mt-2 text-indigo-600">{description}</p>
      </div>
    </motion.div>
  )
}
